cd demo Add Dioxus and the desktop renderer as dependencies (this will edit your Cargo.toml): cargo add dioxus
cargo add dioxus-desktop Edit your main.rs: #![allow(non_snake_case)]
// import the prelude to get access to the `rsx!` macro and the `Scope` and `Element` types
use dioxus::prelude::*; fn main() { // launch the dioxus app in a webview dioxus_desktop::launch(App);
