112.body:
For this guide, we're going to show how to use Dioxus with Axum , but dioxus-fullstack also integrates with the Warp and Salvo web frameworks. Make sure you have Rust and Cargo installed, and then create a new project: cargo new --bin demo
cd demo Add dioxus and dioxus-fullstack as dependencies: cargo add dioxus
cargo add dioxus-fullstack --features axum, ssr Next, add all the Axum dependencies. This will be different if you're using a different Web Framework cargo add tokio --features full
cargo add axum Your dependencies should look roughly like this: [dependencies]
axum = "*"
dioxus = { version = "*" }
dioxus-fullstack = { version = "*", features = ["axum", "ssr"] }
tokio = { version = "*", features = ["full"] } Now, set up your Axum app to serve the Dioxus app. #![allow(non_snake_case, unused)]
use dioxus::prelude::*; #[tokio::main]
async fn main() { #[cfg(feature = "ssr")] { use dioxus_fullstack::prelude::*; let addr = std::net::SocketAddr::from(([127, 0, 0, 1], 8080)); axum::Server::bind(&addr) .serve( axum::Router::new() .serve_dioxus_application("", ServeConfigBuilder::new(app, ())) .into_make_service(), ) .await .unwrap(); }
} fn app(cx: Scope) -> Element { let mut count = use_state(cx, || 0); cx.render(rsx! { h1 { "High-Five counter: {count}" } button { onclick: move |_| count += 1, "Up high!" } button { onclick: move |_| count -= 1, "Down low!" } })
} Now, run your app with cargo run and open http://localhost:8080 in your browser. You should see a server-side rendered page with a counter.

