Right now, the page is static. We can't interact with the buttons. To fix this, we can hydrate the page with dioxus-web. First, modify your Cargo.toml to include two features, one for the server called ssr, and one for the client called web. [dependencies]
# Common dependancies
dioxus = { version = "*" }
dioxus-fullstack = { version = "*" } # Web dependancies
dioxus-web = { version = "*", features=["hydrate"], optional = true } # Server dependancies
axum = { version = "0.6.12", optional = true }
tokio = { version = "1.27.0", features = ["full"], optional = true } [features]
default = []
ssr = ["axum", "tokio", "dioxus-fullstack/axum"]
web = ["dioxus-web"] Next, we need to modify our main.rs to use either hydrate on the client or render on the server depending on the active features. #![allow(non_snake_case, unused)]
use dioxus::prelude::*; fn main() { #[cfg(feature = "web")] dioxus_web::launch_cfg(app, dioxus_web::Config::new().hydrate(true)); #[cfg(feature = "ssr")] { use dioxus_fullstack::prelude::*; tokio::runtime::Runtime::new() .unwrap() .block_on(async move { let addr = std::net::SocketAddr::from(([127, 0, 0, 1], 8080)); axum::Server::bind(&addr) .serve( axum::Router::new() .serve_dioxus_application("", ServeConfigBuilder::new(app, ())) .into_make_service(), ) .await .unwrap(); }); }
} fn app(cx: Scope) -> Element { let mut count = use_state(cx, || 0); cx.render(rsx! { h1 { "High-Five counter: {count}" } button { onclick: move |_| count += 1, "Up high!" } button { onclick: move |_| count -= 1, "Down low!" } })
} Now, build your client-side bundle with dioxus build --features web and run your server with cargo run --features ssr. You should see the same page as before, but now you can interact with the buttons!

114.body:
Let's make the initial count of the counter dynamic based on the current page. Modifying the server To do this, we must remove the serve_dioxus_application and replace it with a custom implementation of its four key functions: Serve static WASM and JS files with serve_static_assets Register server functions with register_server_fns (more information on server functions later) Connect to the hot reload server with connect_hot_reload A custom route that uses SSRState to server-side render the application Modifying the client The only thing we need to change on the client is the props. dioxus-fullstack will automatically serialize the props it uses to server render the app and send them to the client. In the client section of main.rs, we need to add get_root_props_from_document to deserialize the props before we hydrate the app. #![allow(non_snake_case, unused)]
use dioxus::prelude::*;
use dioxus_fullstack::prelude::*; fn main() { #[cfg(feature = "web")] dioxus_web::launch_with_props( app, // Get the root props from the document get_root_props_from_document().unwrap_or_default(), dioxus_web::Config::new().hydrate(true), ); #[cfg(feature = "ssr")] { use axum::extract::Path; use axum::extract::State; use axum::routing::get; tokio::runtime::Runtime::new() .unwrap() .block_on(async move { let addr = std::net::SocketAddr::from(([127, 0, 0, 1], 8080)); axum::Server::bind(&addr) .serve( axum::Router::new() // Serve the dist folder with the static javascript and WASM files created by the dixous CLI .serve_static_assets("./dist") // Register server functions .register_server_fns("") // Connect to the hot reload server in debug mode .connect_hot_reload() // Render the application. This will serialize the root props (the intial count) into the HTML .route( "/", get(move | State(ssr_state): State<SSRState>| async move { axum::body::Full::from( ssr_state.render( &ServeConfigBuilder::new( app, 0, ) .build(), ) )}), ) // Render the application with a different intial count .route( "/:initial_count", get(move |Path(intial_count): Path<usize>, State(ssr_state): State<SSRState>| async move { axum::body::Full::from( ssr_state.render( &ServeConfigBuilder::new( app, intial_count, ) .build(), ) )}), ) .with_state(SSRState::default()) .into_make_service(), ) .await .unwrap(); }); }
} fn app(cx: Scope<usize>) -> Element { let mut count = use_state(cx, || *cx.props); cx.render(rsx! { h1 { "High-Five counter: {count}" } button { onclick: move |_| count += 1, "Up high!" } button { onclick: move |_| count -= 1, "Down low!" } })
} Now, build your client-side bundle with dioxus build --features web and run your server with cargo run --features ssr. Navigate to http://localhost:8080/1 and you should see the counter start at 1. Navigate to http://localhost:8080/2 and you should see the counter start at 2.

115.body:
dixous-server provides server functions that allow you to call an automatically generated API on the server from the client as if it were a local function. To make a server function, simply add the #[server(YourUniqueType)] attribute to a function. The function must: Be an async function Have arguments and a return type that both implement serialize and deserialize (with serde ). Return a Result with an error type of ServerFnError You must call register on the type you passed into the server macro in your main function before starting your server to tell Dioxus about the server function. Let's continue building on the app we made in the getting started guide. We will add a server function to our app that allows us to double the count on the server. First, add serde as a dependency: cargo add serde Next, add the server function to your main.rs: #![allow(non_snake_case, unused)]
use dioxus::prelude::*;
use dioxus_fullstack::prelude::*; fn main() { #[cfg(feature = "web")] dioxus_web::launch_with_props( app, // Get the root props from the document get_root_props_from_document().unwrap_or_default(), dioxus_web::Config::new().hydrate(true), ); #[cfg(feature = "ssr")] { use axum::extract::Path; use axum::extract::State; use axum::routing::get; // Register the server function before starting the server DoubleServer::register().unwrap(); tokio::runtime::Runtime::new() .unwrap() .block_on(async move { let addr = std::net::SocketAddr::from(([127, 0, 0, 1], 8080)); axum::Server::bind(&addr) .serve( axum::Router::new() // Serve the dist folder with the static javascript and WASM files created by the dixous CLI .serve_static_assets("./dist") // Register server functions .register_server_fns("") // Connect to the hot reload server in debug mode .connect_hot_reload() // Render the application. This will serialize the root props (the intial count) into the HTML .route( "/", get(move |Path(intial_count): Path<usize>, State(ssr_state): State<SSRState>| async move { axum::body::Full::from( ssr_state.render( &ServeConfigBuilder::new( app, intial_count, ) .build(), ) )}), ) // Render the application with a different intial count .route( "/:initial_count", get(move |Path(intial_count): Path<usize>, State(ssr_state): State<SSRState>| async move { axum::body::Full::from( ssr_state.render( &ServeConfigBuilder::new( app, intial_count, ) .build(), ) )}), ) .with_state(SSRState::default()) .into_make_service(), ) .await .unwrap(); }); }
} fn app(cx: Scope<usize>) -> Element { let mut count = use_state(cx, || *cx.props); cx.render(rsx! { h1 { "High-Five counter: {count}" } button { onclick: move |_| count += 1, "Up high!" } button { onclick: move |_| count -= 1, "Down low!" } button { onclick: move |_| { to_owned![count]; async move { // Call the server function just like a local async function if let Ok(new_count) = double_server(*count.current()).await { count.set(new_count); } } }, "Double" } })
} #[server(DoubleServer)]
async fn double_server(number: usize) -> Result<usize, ServerFnError> { // Perform some expensive computation or access a database on the server tokio::time::sleep(std::time::Duration::from_secs(1)).await; let result = number * 2; println!("server calculated {result}"); Ok(result)
} Now, build your client-side bundle with dioxus build --features web and run your server with cargo run --features ssr. You should see a new button that multiplies the count by 2.

