Component props are a single struct annotated with #[derive(Props)]. For a component to accept props, the type of its argument must be Scope<YourPropsStruct>. Then, you can access the value of the props using cx.props. There are 2 flavors of Props structs: Owned props: Don't have an associated lifetime Implement PartialEq, allow for memoization (if the props don't change, Dioxus won't re-render the component) Borrowed props: Borrow from a parent component Cannot be memoized due to lifetime constraints Owned Props Owned Props are very simple – they don't borrow anything. Example: // Remember: Owned props must implement `PartialEq`!
#[derive(PartialEq, Props)]
struct LikesProps { score: i32,
} fn Likes(cx: Scope<LikesProps>) -> Element { cx.render(rsx! { div { "This post has ", b { "{cx.props.score}" }, " likes" } })
} You can then pass prop values to the component the same way you would pass attributes to an element: fn App(cx: Scope) -> Element { cx.render(rsx! { Likes { score: 42, }, })
} Screenshot: Likes component Borrowed Props Owned props work well if your props are easy to copy around – like a single number. But what if we need to pass a larger data type, like a String from an App Component to a TitleCard subcomponent? A naive solution might be to .clone() the String, creating a copy of it for the subcomponent – but this would be inefficient, especially for larger Strings. Rust allows for something more efficient – borrowing the String as a &str – this is what Borrowed Props are for! #[derive(Props)]
struct TitleCardProps<'a> { title: &'a str,
} fn TitleCard<'a>(cx: Scope<'a, TitleCardProps<'a>>) -> Element { cx.render(rsx! { h1 { "{cx.props.title}" } })
} We can then use the component like this: fn App(cx: Scope) -> Element { let hello = "Hello Dioxus!"; cx.render(rsx!(TitleCard { title: hello }))
} Screenshot: TitleCard component Borrowed props can be very useful, but they do not allow for memorization so they will always rerun when the parent scope is rerendered. Because of this Borrowed Props should be reserved for components that are cheap to rerun or places where cloning data is an issue. Using Borrowed Props everywhere will result in large parts of your app rerunning every interaction.

