The #[derive(Props)] macro has some features that let you customize the behavior of props. Optional Props You can create optional fields by using the Option<…> type for a field: #[derive(Props)]
struct OptionalProps<'a> { title: &'a str, subtitle: Option<&'a str>,
} fn Title<'a>(cx: Scope<'a, OptionalProps>) -> Element<'a> { cx.render(rsx!(h1{ "{cx.props.title}: ", cx.props.subtitle.unwrap_or("No subtitle provided"), }))
} Then, you can choose to either provide them or not: Title { title: "Some Title",
},
Title { title: "Some Title", subtitle: "Some Subtitle",
},
// Providing an Option explicitly won't compile though:
// Title {
// title: "Some Title",
// subtitle: None,
// }, Explicitly Required Options If you want to explicitly require an Option, and not an optional prop, you can annotate it with #[props(!optional)]: #[derive(Props)]
struct ExplicitOptionProps<'a> { title: &'a str, #[props(!optional)] subtitle: Option<&'a str>,
} fn ExplicitOption<'a>(cx: Scope<'a, ExplicitOptionProps>) -> Element<'a> { cx.render(rsx!(h1 { "{cx.props.title}: ", cx.props.subtitle.unwrap_or("No subtitle provided"), }))
} Then, you have to explicitly pass either Some("str") or None: ExplicitOption { title: "Some Title", subtitle: None,
},
ExplicitOption { title: "Some Title", subtitle: Some("Some Title"),
},
// This won't compile:
// ExplicitOption {
// title: "Some Title",
// }, Default Props You can use #[props(default = 42)] to make a field optional and specify its default value: #[derive(PartialEq, Props)]
struct DefaultProps { // default to 42 when not provided #[props(default = 42)] number: i64,
} fn DefaultComponent(cx: Scope<DefaultProps>) -> Element { cx.render(rsx!(h1 { "{cx.props.number}" }))
} Then, similarly to optional props, you don't have to provide it: DefaultComponent { number: 5,
},
DefaultComponent {}, Automatic Conversion with .into It is common for Rust functions to accept impl Into<SomeType> rather than just SomeType to support a wider range of parameters. If you want similar functionality with props, you can use #[props(into)]. For example, you could add it on a String prop – and &str will also be automatically accepted, as it can be converted into String: #[derive(PartialEq, Props)]
struct IntoProps { #[props(into)] string: String,
} fn IntoComponent(cx: Scope<IntoProps>) -> Element { cx.render(rsx!(h1 { "{cx.props.string}" }))
} Then, you can use it so: IntoComponent { string: "some &str",
},

