use_state is one of the simplest hooks. You provide a closure that determines the initial value use_state gives you the current value, and a way to update it by setting it to something else When the value updates, use_state makes the component re-render, and provides you with the new value For example, you might have seen the counter example, in which state (a number) is tracked using the use_state hook: fn App(cx: Scope) -> Element { // count will be initialized to 0 the first time the component is rendered let mut count = use_state(cx, || 0); cx.render(rsx!( h1 { "High-Five counter: {count}" } button { onclick: move |_| { // changing the count will cause the component to re-render count += 1 }, "Up high!" } button { onclick: move |_| { // changing the count will cause the component to re-render count -= 1 }, "Down low!" } ))
} Screenshot: counter app Every time the component's state changes, it re-renders, and the component function is called, so you can describe what you want the new UI to look like. You don't have to worry about "changing" anything – just describe what you want in terms of the state, and Dioxus will take care of the rest! use_state returns your value wrapped in a smart pointer of type UseState . This is why you can both read the value and update it, even within an event handler. You can use multiple hooks in the same component if you want: fn App(cx: Scope) -> Element { let mut count_a = use_state(cx, || 0); let mut count_b = use_state(cx, || 0); cx.render(rsx!( h1 { "Counter_a: {count_a}" } button { onclick: move |_| count_a += 1, "a++" } button { onclick: move |_| count_a -= 1, "a--" } h1 { "Counter_b: {count_b}" } button { onclick: move |_| count_b += 1, "b++" } button { onclick: move |_| count_b -= 1, "b--" } ))
