You can use cx.use_hook to build your own hooks. In fact, this is what all the standard hooks are built on! use_hook accepts a single closure for initializing the hook. It will be only run the first time the component is rendered. The return value of that closure will be used as the value of the hook – Dioxus will take it, and store it for as long as the component is alive. On every render (not just the first one!), you will get a reference to this value. Note: You can implement Drop for your hook value – it will be dropped then the component is unmounted (no longer in the UI) Inside the initialization closure, you will typically make calls to other cx methods. For example: The use_state hook tracks state in the hook value, and uses cx.schedule_update to make Dioxus re-render the component whenever it changes. Here is a simplified implementation of the use_state hook: use std::cell::RefCell;
use std::rc::Rc;
use std::sync::Arc; #[derive(Clone)]
struct UseState<T> { value: Rc<RefCell<T>>, update: Arc<dyn Fn()>,
} fn my_use_state<T: 'static>(cx: &ScopeState, init: impl FnOnce() -> T) -> &UseState<T> { cx.use_hook(|| { // The update function will trigger a re-render in the component cx is attached to let update = cx.schedule_update(); // Create the initial state let value = Rc::new(RefCell::new(init())); UseState { value, update } })
} impl<T: Clone> UseState<T> { fn get(&self) -> T { self.value.borrow().clone() } fn set(&self, value: T) { // Update the state *self.value.borrow_mut() = value; // Trigger a re-render on the component the state is from (self.update)(); }
} The use_context hook calls cx.consume_context (which would be expensive to call on every render) to get some context from the scope Here is an implementation of the use_context and use_context_provider hooks: pub fn use_context<T: 'static + Clone>(cx: &ScopeState) -> Option<&T> { cx.use_hook(|| cx.consume_context::<T>()).as_ref()
} pub fn use_context_provider<T: 'static + Clone>(cx: &ScopeState, f: impl FnOnce() -> T) -> &T { cx.use_hook(|| { let val = f(); // Provide the context state to the scope cx.provide_context(val.clone()); val })
}

