} static INPUT_ERROR: Atom<InputError> = |_| InputError::None; Then, in our top level component, we want to explicitly handle the possible error state for this part of the tree. fn TopLevel(cx: Scope) -> Element { let error = use_read(cx, INPUT_ERROR); match error { TooLong => return cx.render(rsx!{ "FAILED: Too long!" }), TooShort => return cx.render(rsx!{ "FAILED: Too Short!" }), _ => {} }
